description:
Elisabeth Shue eller Laura som hennes karaktar heter, vantar sitt forsta barn. 
Men efter komplikationer vid fodseln sa borjar hon att ma psykiskt daligt... 
Hon borjar att se i syne och litar inte pa nagon, det gar sa langt att hon till och med blir sjalvdestruktiv. 
Med Elisabeth Shue, Steven Mackintosh, Kathleen Chalfant, Tim Hopper m fl.
